import Particles from 'react-particles-js';
import Counter from './features/Counter';

function App() {
  return (
    <div className="App">
    {/* <Counter /> */}
     <Particles
        params={{
          particles: {
            number: {
              value: 200,
              density: {
                enable: true,
                value_area: 1000,
              }
            },
          },
        }}
      />
    </div>
  );
}

export default App;
